var commonJs={autoScrollTop:function(){$("html,body").animate({scrollTop:0})},gotoTop:function(){$("body").append('<div id="go_top" style="position:fixed;right:20px;bottom:20px;"><img alt="返回顶部" />返回顶部</div>'),$("#go_top").hide(),$(window).scroll(function(){$(window).scrollTop()>100?$("#go_top").fadeIn(500):$("#go_top").fadeOut(500)}),$("#go_top").click(function(){return $("body,html").animate({scrollTop:0},100),!1})}};